			</p>
			<div>
				<input className="f4 pa2 w-20 center" type='text'/>
				<button className="w-30 grow f4 link ph3 pv2 dib white bg-light-black">Detect</button>
			</div>

		</div>
	)
}

export default ImageLinkForm;
